Defendant Natalie M Demore in court with attorney Kelsey Morin.  Andrea M Will appeared for the State of Wisconsin.  Defendant pleads guilty to count #3.  Court finds the defendant guilty of count #3.  Counts #1 and 2 are dismissed and read in.  State makes recommendations.  Attorney Morin makes statements.  Defendant makes statements. 
The Court Orders the Following:  Count #3.  
Imposed and Stayed Sentence of:
6 months Huber with STANDARD RELEASE CONDITIONS.  (Credit - 0 days).  
Term of Probation: 2 Years
Conditions of Probation:
Follow through with any treatment and/or counseling recommended by Agent;
No contact with Pick N Save.
AODA Assessment and follow through with any treatment recommended;
Absolute Sobriety; Random U.A.s;
No Use or Possession of illegal controlled substances or drug paraphernalia;
Inform agent of all prescriptions;
Disclose to any physician in writing your drug history/dependency signed by your physician and provide a copy to your Agent. 
Sign all Releases for Agent;
Seek employment / school as deemed by agent;
COSTS:  $243.00 to be paid as a condition of probation
DNA Surcharge: $200.00 to be paid as a condition of probation
DNA Sample ordered and to be provided immediately if in custody or within (3) business days at the Waukesha County Sheriff Department. 
Expunction is denied.  
Court orders the jail to continue the defendants methodone treatment due to her current pregnancy.
